from django.contrib import admin
from django.utils.html import format_html

# Register your models here.
from .models import Seat

@admin.register(Seat)
class SeatAdmin(admin.ModelAdmin):
    list_display = ('name', 'user', 'display_qr_code', 'image')
    list_filter = ('user',)
    search_fields = ('name', 'user__username')


    def display_qr_code(self, obj):
        qr_image = obj.generate_qr_code()
        return format_html('<img width="50" height="50" src="data:image/png;base64,{}"/>', qr_image)
    display_qr_code.short_description = 'QR Code'
    
    def image(self, obj):
        thing = """data:image/png;base64,"""
        return format_html('<img width="50", height="50", src="{}"/>', thing)
